import './Product.css';

const Product = ({ name, imageSrc, link, thumbsUpVisible, thumbsDownVisible, buyNowVisible, onThumbsUp, onThumbsDown }) => {
  return (
    <div className="product">
      <img src={imageSrc} alt={name} className="product-image" />
      <div className="product-name">{name}</div>
      {thumbsUpVisible && thumbsDownVisible && (
        <div className="product-actions">
          <button className="thumbs-up" onClick={onThumbsUp}>
            üëç
          </button>
          <button className="thumbs-down" onClick={onThumbsDown}>
            üëé
          </button>
        </div>
      )}
      {buyNowVisible && (
        <div className="buy-now">
          <a href={link} target="_blank" rel="noopener noreferrer">
            Buy Now
          </a>
        </div>
      )}
    </div>
  );
};

export default Product;
